var pointsblue = document.querySelector('pointsblue'); 
var groups1 = document.querySelectorAll('.cls-1');
var groups2 = document.querySelectorAll('.cls-2');

var pointers = [];

for (var key in groups1) { 
  console.log(key)
  if (groups1.hasOwnProperty(key)) { 
    var element = groups1[key]; 
    pointers.push(element);
